import React from 'react'

const ImgShow = (props) => {
    const img = `https://images.unsplash.com/${props.name}/unsplash-kitsune-4.jpg?ixlib=rb-0.3.5&q=80&fm=jpg&crop=entropy&cs=tinysrgb&w=400&fit=max&ixid=eyJhcHBfaWQiOjEyMDd9&s=fb86e2e09fceac9b363af536b93a1275`
  return (
    <>
      <div>
        <img src={img} alt="any image"/>
      </div>
    </>
  )
}

export default ImgShow
